        /// <summary>
        /// input index then find a random array(16 bytes)
        /// </summary>
        /// <param name="index">input index</param>
        /// <returns>16 bytes random data</returns>
        public byte[] Get_RandomFromIndex(int index)
        {
            if (0 > index || (RndGenerator._randData.Length < (index + RndGenerator.DATA_LENGTH)))
            {
                throw new ArgumentOutOfRangeException("specified index out of range(max:" + RndGenerator.DATA_LENGTH + ") : " + index);
            }
            byte[] result = new byte[RndGenerator.DATA_LENGTH];
            Buffer.BlockCopy(RndGenerator._randData, index, result, 0, RndGenerator.DATA_LENGTH);
            return result;
        }

        /// <summary>
        /// get a random array(16 bytes) and output start index
        /// </summary>
        /// <param name="index">output start index</param>
        /// <returns>a random array(16 bytes)</returns>
        public byte[] Get_Random(out int index)
        {
            Random rnd = new Random(Guid.NewGuid().GetHashCode());
            index = rnd.Next(0,(RndGenerator._randData.Length - RndGenerator.DATA_LENGTH + 1));
            return this.Get_RandomFromIndex(index);
        }

        public int GetMaxIndex()
        {
            return (RndGenerator._randData.Length - RndGenerator.DATA_LENGTH);
        }

        /// <summary>
        /// 產生指定大小的隨機byte數據檔案
        /// </summary>
        /// <param name="randomCount">byte數量</param>
        public static void WriteFile(int randomCount,string fileName)
        {
            RandomNumberGenerator ranObj = new RNGCryptoServiceProvider();
            byte[] randomData = new byte[randomCount];
            string filePath = AppDomain.CurrentDomain.BaseDirectory + @"\" + fileName;
            // 1. Byte Array產生Random數據
            ranObj.GetBytes(randomData);
            ranObj.Dispose();
            // 2. 寫入字串並稍為改寫字串表達意義
            StringBuilder ranStr = new StringBuilder();
            foreach (byte b in randomData)
            {
                ranStr.Append(String.Format("0x{0:X2}, ", b));
            }
            // 3. 寫入檔案流中
            using (FileStream fs = new FileStream(filePath, FileMode.Create, FileAccess.Write))
            {
                using (StreamWriter sw = new StreamWriter(fs, Encoding.UTF8))
                {
                    sw.Write(ranStr.ToString(0, ranStr.Length - 2));//多兩個字串 => ", " 所以扣2
                    sw.Flush();
                }
            }
        }
    }
